import { useState } from "react";
import LoginPage from "./View/LoginPage.tsx";
import Home from "./View/Home.tsx";

function App() {
  const [user, setUser] = useState();

  return user ? <Home user={user} /> : <LoginPage user={[user, setUser]} />;
}

export default App;
